import React from "react";
import s from "./Catalog.module.css";
import img from "../../../assets/images/games-img.png";
import { NavLink } from "react-router-dom";

const Catalog = (props) => {
  console.log(props);
  const changeStatus = () => {
    window.scrollTo(0, 0);
    props.setStatus("browse");
  };
  return (
    <div className={s.catalog}>
      <div className={s.content}>
        <div className={s.title}>Browse</div>
        <div className={s.text}>
          Explore our catalog for your next favorite game!
        </div>
        <div className={s.btn} onClick={() => changeStatus("browse")}>
          <NavLink to="/store/browse">Browse all</NavLink>
        </div>
      </div>
      <div className={s.image}>
        <img src={img} />
      </div>
    </div>
  );
};

export default Catalog;
